<meta http-equiv="pragma" content="no-cache">
<meta http-equiv="cache-control" content="no-cache, must-revalidate">
<meta http-equiv="expires" content="0">
<script>
	document.write("<link rel='stylesheet' href='https://www.zoomeye.org/css/base.css?version=" + new Date() + "' type='text/css' />");
	document.write("<link rel='stylesheet' href='https://www.zoomeye.org/css/login.css?version=" + new Date() + "' type='text/css' />");	
</script>
</head>
<body>
<div class="container">
    <div class="loginpart">
        <div class="loginleft">
	    <div id="logoAre" class="logo appLogo_img"></div>
	    </div>
        <div class="loginright">
	        <div class="languagepart">
	            <div class="languageshow"><label id="laCurrentLanguage"></label></div>
	            <div class="languagechange" id="divLanguageChoose"></div>
	        </div>
	        <div class="loginbar">
	            <div><label name="lausername" class="loginlabel"></label><input name="UserName" id='UserName' class="logininputwidth" type="text" maxlength="32" /></div>
                <div><label name="lapassword" class="loginlabel"></label><input name="Password" id="Password" class="logininputwidth" type="Password" maxlength="16" /></div>
	            <div class="loginbtn" onclick="DoLogin()" onmouseover="this.className = 'loginbtnon'" onmouseout="this.className = 'loginbtn'"><label name="lalogin" class="mousepointer"></label></div>
                <div class="anonymous" id="divAnonymous"><input id="chAnonymous" type="checkbox" class="checkbox"/>&nbsp;<label class="loginlabel" name="laAnonymous"></label></div>
	        </div>
	    </div>	
    </div>
    <div class="footer">
    	<label id="laCopyRight"></label>
    </div>
</div>
<div id="divChangePassword" class="displaynone msg-content-wrap">
    <div class="windowtile"><label name="activeDevice"></label></div>
    <div class="msg-content">
        <div class="password"><span class="desc"><label name="geUserName"></label></span><span><label id="defaultUser"></label></span></div>
        <div class="password"><span class="desc"><label name="gePassword"></label></span><span id="pwdblock"><input type="password" id="newPassword" maxlength="16" onkeyup="onPswInput()" onpaste="return false;" /></span></div>
        <div class="passwordStrength" id="divPswStrength">
            <div class="validate">
                <span class="userstrength"></span>
                <span class="userstrength"></span>
                <span class="userstrength"></span>
                <span id="strengthTips"></span>
            </div>
            <div class="clear"></div>
            <div><label name="passwordTips"></label></div>
        </div>
        <div class="password"><span class="desc"><label name="laCheckPwd"></label></span><input type="password" onpaste="return false;" id="newComfirmPassword" maxlength="16" /></div>
        <!--<div id="divAskAgain"><input type="checkbox" id="chAskAgain">&nbsp;<label name="laNoAskToChange"></label></div>-->
        <div class="password passwordtips">
            <span class="desc">&nbsp;</span>
            <span id="passwordtips"></span>
        </div>
    </div>
    <div class="userfoot">
        <span><input type="button" class="savebtn" id="btnOK" name="laOK"/></span>
    </div>
</div>
<script type="text/javascript" src="../script/LAB.min.js"></script>
<script>
	$LAB
	.script("../script/global_config.js?version=" + new Date()).wait(function () {
		$LAB
		.script("../script/jquery-1.7.1.min.js").wait()
		.script("../script/jquery.cookie.js").wait()
		.script("../script/Translator.js?version=" + global_config.web_version).wait()
		.script("../script/common.js?version=" + global_config.web_version).wait()
		.script("../script/jquery_modal.js").wait()
		.script("../script/encryption.js").wait()
		.script("../script/AES.js").wait()
		.script("../script/cryptico.min.js").wait()
		.script("../script/login.js?version=" + global_config.web_version).wait(function () {
			InitLogin();
		});		
	});
</script>
</body>
</html>

